import React, { Component } from 'react';
//Imports React methods and the Component class form React Library

class KanyeBest extends Component {
  //the component we created "KanyeBest" - inherits from the Component React library class to create component definitions. creates new Component subclass called KanyeBest
  //Because it extends (also known as inherits from) Component, oKanye class gets to reuse code and capabilities from React.Component.
  render() {
    return (
      <h1>Kanye's Best</h1>
    )
  }
}

export default KanyeBest
